            </Head>
            <button onClick={handleClick}>Go Back</button>
            <div>Author { userId } Details:</div>
            
        <ul>    
            {postData.map((postdeet) => (
                    <li key={postdeet.userId}>
                          {postdeet.title}
                          {postdeet.body}
                    </li> 
                ))}
        </ul>

        <button onClick={handleClick}>AuthorDetails</button>
        </>
        )
    }


  
 
   

export async function getStaticPaths() {
  const res = await fetch(`https://jsonplaceholder.typicode.com/posts/`)
  const postData = await res.json()
  var paths = [];
  var userId = JSON.stringify(paths);
  for (var i in postData)
    paths.push(postData[i]);

  return {
    paths: [
      { params: { postData, userId } }
    ],

    fallback: true
  }
}

export async function getStaticProps( {params} ) {
  console.log("PARAM: ", params)
  var url = new URL("https://jsonplaceholder.typicode.com/posts/?q=userId:" + params)
  fetch(url)
  console.log("RESOURCE: ", url)

  const postData = await res.json()
  console.log(postData)

  if (!postData) {
    return {
      notFound: true,
    }
  }

  return {
    props: {
      postData
    }
  }
}
   


export default Post;
